import { useState } from "react";
import AddMovie from "./AddMovie";

function NavBar (){
  const [show, setShow] = useState("true");
    return(
 <>
    <Navbar bg="light" variant="light">
        <Container>
        <Navbar.Brand href="#home">Movies</Navbar.Brand>
        <Nav>
          <Button variant="outline-success" style={{width:"150px"}}  onClick={() => setShow(!show)} >Add New Movie</Button>
        </Nav>
        <Form className="d-flex">
              <FormControl
                type="search"
                placeholder="Search"
                className="me-2"
                aria-label="Search"
              />
        </Form>
        </Container>

    </Navbar>
    <div className="Add">
    <AddMovie  />
    </div>


 </>
    )
}
export default NavBar;
